  ],
  ['polyline', { points: '14 2 14 8 20 8', key: '1ew0cm' }],
  ['path', { d: 'M10 12h2v6', key: '12zw74' }],
  ['rect', { width: '4', height: '6', x: '2', y: '12', key: '1svnui' }],
  ['path', { d: 'M10 18h4', key: '1ulq68' }],
]);

export default FileDigit;
